import React from 'react';
import './Projects.css';

class Projects extends React.Component {
    render() {
        return(
            <div className="projects-container">
                <h1>Projects</h1>
                <ol className="gradient-list">
                    <li>PC Build</li>
                    <li>Pump Mounting Bracket</li>
                    <li></li>
                </ol>
            </div>
        )
    }
}

export default Projects
